["import com.fasterxml.jackson.annotation.JsonCreator;
import com.fasterxml.jackson.annotation.JsonProperty;
import com.fasterxml.jackson.databind.ObjectMapper;
import com.fasterxml.jackson.databind.annotation.JsonSerialize;
import com.fasterxml.jackson.databind.annotation.JsonDeserialize;

import java.util.UUID;

public record AggregateId(UUID id) {}

public class Aggregate {

    public final AggregateId aggregateId;

    @JsonCreator
    public Aggregate(@JsonProperty("aggregateId") AggregateId aggregateId) {
        this.aggregateId = aggregateId;
    }
}

@JsonSerialize
@JsonDeserialize(using = AggregateIdSerializer.class)
public static class AggregateIdSerializer extends com.fasterxml.jackson.databind.JsonSerializer<AggregateId> {
    @Override
    public void serialize(AggregateId value, com.fasterxml.jackson.core.JsonGenerator gen, com.fasterxml.jackson.databind.SerializerProvider serializers) throws java.io.IOException {
        gen.writeString(value.id().toString());
    }
}

public static void main(String[] args) throws Exception {
    ObjectMapper objectMapper = new ObjectMapper();
    String content = "{"aggregateId":"3f61aede-83dd-4049-a6ff-337887b6b807"}";
    Aggregate aggregate = objectMapper.readValue(content, Aggregate.class);
    System.out.println(objectMapper.writeValueAsString(aggregate));
}
