["import java.time.YearWeek;
import java.time.format.DateTimeFormatter;

public class WeekOperations {

    public static boolean isBefore(String weekA, String weekB) {
        YearWeek ywA = YearWeek.parse(weekA, DateTimeFormatter.ISO_WEEK_DATE);
        YearWeek ywB = YearWeek.parse(weekB, DateTimeFormatter.ISO_WEEK_DATE);
        return ywA.isBefore(ywB);
    }

    public static long weeksBetween(String weekA, String weekB) {
        YearWeek ywA = YearWeek.parse(weekA, DateTimeFormatter.ISO_WEEK_DATE);
        YearWeek ywB = YearWeek.parse(weekB, DateTimeFormatter.ISO_WEEK_DATE);
        return ywB.toEpochWeek() - ywA.toEpochWeek();
    }
}
