["public static boolean equalSplit(int[] arr) {
    if (arr.length % 2 != 0)
        return false;
    return equalSplit(arr, 0, 0, arr.length / 2, arr.length / 2);
}

public static boolean equalSplit(int[] arr, int startSum, int endSum, int start, int end) {
    if (start == startSum && end == endSum)
        return startSum == endSum;
    
    if (start < end) {
        return equalSplit(arr, startSum + arr[start], endSum, start + 1, end) ||
               equalSplit(arr, startSum, endSum + arr[end], start, end - 1);
    }
    return false;
}
