        testLabel.setOnMouseEntered(this::doSomething);
        testLabel.setOnMouseExited(this::doSomethingElse);

        testLabel.setOnMousePressed(event -> handleMousePress(event));
        return testLabel;
    }

    public void doSomething(MouseEvent event) {
        // System.out.println("Inside label.");
    }

    public void doSomethingElse(MouseEvent event) {
