["public List<Product> searchProducts(String searchQuery, Pageable pageable) {
    MatchOperation matchOperation = Aggregation.match(
        Criteria.where("companyNo").in(10000009)
            .and("status").in("ACTIVE", "IN_ACTIVE", "OUT_OF_STOCK")
            .and("productName").regex(searchQuery, "i")
    );

    UnionWithOperation unionWithSubCategory = Aggregation.unionWith("product", Aggregation.newAggregation(
        Aggregation.match(
            Criteria.where("companyNo").in(10000009)
                .and("status").in("ACTIVE", "IN_ACTIVE", "OUT_OF_STOCK")
                .and("subCategoryName").regex(searchQuery, "i")
        )
    ));

    UnionWithOperation unionWithCategory = Aggregation.unionWith("product", Aggregation.newAggregation(
        Aggregation.match(
            Criteria.where("companyNo").in(10000009)
                .and("status").in("ACTIVE", "IN_ACTIVE", "OUT_OF_STOCK")
                .and("categoryName").regex(searchQuery, "i")
        )
    ));

    UnionWithOperation unionWithBrand = Aggregation.unionWith("product", Aggregation.newAggregation(
        Aggregation.match(
            Criteria.where("companyNo").in(10000009)
                .and("status").in("ACTIVE", "IN_ACTIVE", "OUT_OF_STOCK")
                .and("brandName").regex(searchQuery, "i")
        )
    ));

    Aggregation aggregation = Aggregation.newAggregation(
        matchOperation,
        unionWithSubCategory,
        unionWithCategory,
        unionWithBrand,
        Aggregation.skip((long) pageable.getOffset()),
        Aggregation.limit(pageable.getPageSize())
    );

    AggregationResults<Product> results = mongoTemplate.aggregate(aggregation, "product", Product.class);
    return results.getMappedResults();
}
