["import java.lang.invoke.MethodHandles;
import java.lang.invoke.VarHandle;
import java.nio.ByteBuffer;
import java.nio.LongBuffer;

public class LargeArray {
    private static final VarHandle LONG_HANDLE;
    private final ByteBuffer buffer;
    private final LongBuffer longBuffer;

    static {
        try {
            LONG_HANDLE = MethodHandles.byteArrayViewVarHandle(long[].class, java.nio.ByteOrder.nativeOrder());
        } catch (NoSuchFieldException | IllegalAccessException e) {
            throw new AssertionError(e);
        }
    }

    public LargeArray(long size) {
        buffer = ByteBuffer.allocateDirect((int) (size * Long.BYTES));
        longBuffer = buffer.asLongBuffer();
    }

    public void set(long index, long value) {
        LONG_HANDLE.set(buffer, index * Long.BYTES, value);
    }

    public long get(long index) {
        return (long) LONG_HANDLE.get(buffer, index * Long.BYTES);
    }
}
