["import okhttp3.*;
import java.io.IOException;

public class OAuth2Example {

    private static final String TOKEN_URL = "https://example.com/oauth2/token";
    private static final String CLIENT_ID = "your-client-id";
    private static final String CLIENT_SECRET = "your-client-secret";
    private static final String SCOPE = "your-scope";
    private static final String GRANT_TYPE = "client_credentials";

    public static void main(String[] args) throws IOException {
        String token = getOAuth2Token();
        String response = makeApiRequest(token);
        System.out.println(response);
    }

    public static String getOAuth2Token() throws IOException {
        OkHttpClient client = new OkHttpClient();
        
        RequestBody body = new FormBody.Builder()
            .add("grant_type", GRANT_TYPE)
            .add("client_id", CLIENT_ID)
            .add("client_secret", CLIENT_SECRET)
            .add("scope", SCOPE)
            .build();
        
        Request request = new Request.Builder()
            .url(TOKEN_URL)
            .post(body)
            .build();

        try (Response response = client.newCall(request).execute()) {
            if (response.isSuccessful()) {
                String responseBody = response.body().string();
                // Extract token from response (depends on response format)
                // Assuming it's in JSON format like {"access_token": "your_token"}
                return responseBody; // You should parse the token from the response
            } else {
                throw new IOException("Failed to get token: " + response.message());
            }
        }
    }

    public static String makeApiRequest(String token) throws IOException {
        OkHttpClient client = new OkHttpClient();

        Request request = new Request.Builder()
            .url("https://example.com/api/resource")
            .header("Authorization", "Bearer " + token)
            .build();

        try (Response response = client.newCall(request).execute()) {
            if (response.isSuccessful()) {
                return response.body().string();
            } else {
                throw new IOException("API request failed: " + response.message());
            }
        }
    }
}
