["public List<int[]> patternSearch(int[][] T, int[][] P) {
    List<int[]> result = new ArrayList<>();
    int m = T.length, n = T[0].length;
    int u = P.length, v = P[0].length;

    for (int i = 0; i <= m - u; i++) {
        for (int j = 0; j <= n - v; j++) {
            boolean match = true;
            for (int x = 0; x < u; x++) {
                for (int y = 0; y < v; y++) {
                    if (P[x][y] != 0 && P[x][y] != T[i + x][j + y]) {
                        match = false;
                        break;
                    }
                }
                if (!match) break;
            }
            if (match) result.add(new int[]{i, j});
        }
    }
    return result;
}
