["class LRUCache {
    int capacity;
    Map<Integer, Integer> map;
    Map<Integer, DoublyLinkedNode> nodeMap;
    DoublyLinkedNode head, tail;

    public LRUCache(int capacity) {
        this.capacity = capacity;
        map = new HashMap<>();
        nodeMap = new HashMap<>();
        head = new DoublyLinkedNode(-1, -1);
        tail = new DoublyLinkedNode(-1, -1);
        head.next = tail;
        tail.prev = head;
    }

    public int get(int key) {
        if (map.containsKey(key)) {
            moveToHead(key);
            return map.get(key);
        }
        return -1;
    }

    public void put(int key, int value) {
        if (map.containsKey(key)) {
            map.put(key, value);
            moveToHead(key);
        } else {
            if (map.size() >= capacity) {
                removeLRU();
            }
            map.put(key, value);
            addNodeToHead(key);
        }
    }

    private void moveToHead(int key) {
        DoublyLinkedNode node = nodeMap.get(key);
        removeNode(node);
        addNodeToHead(node);
    }

    private void removeLRU() {
        DoublyLinkedNode node = tail.prev;
        removeNode(node);
        map.remove(node.key);
    }

    private void addNodeToHead(int key) {
        DoublyLinkedNode node = new DoublyLinkedNode(key, map.get(key));
        nodeMap.put(key, node);
        node.next = head.next;
        node.prev = head;
        head.next.prev = node;
        head.next = node;
    }

    private void removeNode(DoublyLinkedNode node) {
        node.prev.next = node.next;
        node.next.prev = node.prev;
    }

    class DoublyLinkedNode {
        int key, value;
        DoublyLinkedNode prev, next;

        public DoublyLinkedNode(int key, int value) {
            this.key = key;
            this.value = value;
        }
    }
}
