["import javafx.application.Application;
import javafx.scene.Scene;
import javafx.scene.control.Spinner;
import javafx.scene.control.SpinnerValueFactory;
import javafx.scene.control.TextField;
import javafx.scene.layout.StackPane;
import javafx.stage.Stage;
import javafx.util.converter.DoubleStringConverter;
import java.text.DecimalFormat;
import java.util.regex.Pattern;
import java.util.function.UnaryOperator;

public class TestPane extends Application {

    @Override
    public void start(Stage primaryStage) {
        Spinner<Double> spinner = new Spinner<>();
        SpinnerValueFactory<Double> valueFactory = new SpinnerValueFactory.DoubleSpinnerValueFactory(-20.00, 20.00, 0.00, 0.25);
        spinner.setValueFactory(valueFactory);

        TextField editor = spinner.getEditor();
        DecimalFormat format = new DecimalFormat("+#0.00;-#0.00");

        Pattern validDoubleText = Pattern.compile("[+-]?\d{0,2}(\,\d{0,2})?");
        UnaryOperator<TextFormatter.Change> filter = c -> {
            String newText = c.getControlNewText();
            if (validDoubleText.matcher(newText).matches()) {
                return c;
            } else {
                return null;
            }
        };

        TextFormatter<Double> textFormatter = new TextFormatter<>(new DoubleStringConverter(), 0.00, filter);
        editor.setTextFormatter(textFormatter);

        spinner.valueProperty().addListener((obs, oldValue, newValue) -> {
            editor.setText(format.format(newValue));
        });

        StackPane root = new StackPane();
        root.getChildren().add(spinner);

        Scene scene = new Scene(root, 300, 250);
        primaryStage.setTitle("Spinner Example");
        primaryStage.setScene(scene);
        primaryStage.show();
    }

    public static void main(String[] args) {
        launch(args);
    }
}
