        Spinner<Integer> spinnerMin = new Spinner<>();
        Spinner<Integer> spinnerMax = new Spinner<>();
        
        spinnerMin.setValueFactory(new SpinnerValueFactory.IntegerSpinnerValueFactory(2, 6, 2));
        spinnerMax.setValueFactory(new SpinnerValueFactory.IntegerSpinnerValueFactory(2, 6, 6));
        
        spinnerMin.valueProperty().addListener((observable, oldValue, newValue) -> {
            spinnerMax.setValueFactory(new SpinnerValueFactory.IntegerSpinnerValueFactory(newValue, 6, spinnerMax.getValue()));
            if (newValue.equals(spinnerMax.getValue())) {
                spinnerMin.getEditor().setStyle("-fx-opacity: 0.5;");
