        });
        
        spinnerMax.valueProperty().addListener((observable, oldValue, newValue) -> {
            spinnerMin.setValueFactory(new SpinnerValueFactory.IntegerSpinnerValueFactory(2, newValue, spinnerMin.getValue()));
            if (newValue.equals(spinnerMin.getValue())) {
