["import java.util.concurrent.*;
import java.util.concurrent.locks.*;

public class Task implements Runnable {

    private final String x;
    private static final ConcurrentMap<String, Lock> locks = new ConcurrentHashMap<>();

    public Task(String x) {
        this.x = x;
    }

    @Override
    public void run() {
        Lock lock = getLock(x);
        try {
            lock.lock();
            System.out.println(x);
            Thread.sleep(5000);
        } catch (InterruptedException e) {
            Thread.currentThread().interrupt();
        } finally {
            lock.unlock();
        }
    }

    private Lock getLock(String key) {
        return locks.computeIfAbsent(key, k -> new ReentrantLock());
    }

    public static void main(String[] args) {
        ExecutorService executor = Executors.newFixedThreadPool(5);

        executor.submit(new Task("hi"));
        executor.submit(new Task("h"));
        executor.submit(new Task("u"));
        executor.submit(new Task("y"));
        executor.submit(new Task("hi"));
        executor.submit(new Task("p"));
        executor.submit(new Task("o"));
        executor.submit(new Task("bb"));

        executor.shutdown();
    }
}
