["import java.util.Random;

public class CardShuffle {

    public static void shuffleDeck(Card[] unshuffledDeck) {
        Random shuffleRandom = new Random();
        int cardAmount = unshuffledDeck.length;
        Card[] shuffledDeck = new Card[cardAmount];
        boolean[] used = new boolean[cardAmount];

        for (int i = 0; i < cardAmount; i++) {
            int j;
            do {
                j = shuffleRandom.nextInt(cardAmount);
            } while (used[j]);
            shuffledDeck[i] = unshuffledDeck[j];
            used[j] = true;
        }
    }
}
