        List<String> result = new ArrayList<>();
        String pid = getCurrentPid();
        
        try {
            Process process = Runtime.getRuntime().exec("cmd.exe /c handle.exe -accepteula " + filePath);
            process.waitFor();
            String output = new String(process.getInputStream().readAllBytes());
