public String getFullyQualifiedNameOfLinkReference(LinkTree linkTree, DocTrees docTrees, Trees trees, Elements elements, Types types) {
    String reference = linkTree.getReference().getSignature();
    Element element = trees.getElement(linkTree);
    
    if (element != null) {
        TypeMirror typeMirror = element.asType();
        return types.asElement(typeMirror).toString();
    } else {
        return reference; // fallback to the reference itself if element is null
    }
}
