["import java.lang.module.ModuleFinder;
import java.lang.module.ModuleReference;
import java.util.Set;

public class CoreAndNonCoreModules {

    public static void main(String[] args) {
        Set<ModuleReference> modules = ModuleFinder.ofSystem().findAll();

        modules.forEach(module -> {
            String moduleName = module.descriptor().name();
            ClassLoader classLoader = module.reference().getClass().getClassLoader();
            
            if (classLoader == null) {
                System.out.println(moduleName + " is part of core (boot classloader)");
            } else {
                System.out.println(moduleName + " is part of non-core (platform class loader)");
            }
        });
    }
}
