import org.mockito.*;
import org.springframework.beans.factory.annotation.Autowired;
import java.util.Optional;
import java.util.UUID;

public class PriceServiceTest {

    @Mock
    private PriceRepository priceRepository;

    @InjectMocks
    private PriceService priceService;

    @Test
    public void testUpdatePrice() {
        UUID priceUuid = UUID.randomUUID();
        PriceRequest request = new PriceRequest();
        request.setPriceAmount(100.0);

        Price existingPrice = new Price();
        existingPrice.setItemCode(1);
        existingPrice.setTitle("Old Price");
        existingPrice.setPriceAmount(50.0);

        Price updatedPrice = new Price();
        updatedPrice.setItemCode(1);
        updatedPrice.setTitle("Old Price");
        updatedPrice.setPriceAmount(100.0);

        when(priceRepository.findByUuid(priceUuid)).thenReturn(Optional.of(existingPrice));
        when(priceRepository.saveAndFlush(existingPrice)).thenReturn(updatedPrice);

        PriceDTO result = priceService.update(priceUuid, request);

        assertEquals(100.0, result.getPriceAmount());
        verify(priceRepository, times(1)).saveAndFlush(existingPrice);
    }
}
