["public void saveFileToExternalStorage(String assetPath, String fileName) {
    AssetManager assetManager = requireContext().getAssets();
    FileOutputStream out = null;
    InputStream in = null;
    Context context = requireContext();
    try {
        File databasesFolder = new File(context.getExternalFilesDir(null).getParent(), "com.mydb.orca/databases");
        if (!databasesFolder.exists()) {
            databasesFolder.mkdirs();
        }
        File outFile = new File(databasesFolder, fileName);
        in = assetManager.open(assetPath + "/" + fileName);
        out = new FileOutputStream(outFile);
        copyFile(in, out);
    } catch (IOException e) {
        e.printStackTrace();
    } finally {
        try {
            if (in != null) in.close();
            if (out != null) out.flush();
            if (out != null) out.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
}

private void copyFile(InputStream in, OutputStream out) throws IOException {
    byte[] buffer = new byte[1024];
    int read;
    while ((read = in.read(buffer)) != -1) {
        out.write(buffer, 0, read);
    }
}
