["public static boolean search(int[][] mat, int num) {
    int n = mat.length, r = n / 2, c = n / 2;
    while (r >= 0 && r < n && c >= 0 && c < n) {
        if (mat[r][c] == num) return true;
        if (num < mat[r][c]) {
            if (c > 0 && num >= mat[r][c - 1]) c--;
            else r--;
        } else {
            if (r < n - 1 && num <= mat[r + 1][c]) r++;
            else c++;
        }
    }
    return false;
}
