["public String convertDmnRuleTestResultToCsv(DmnRuleTestResult result) {
    List<DmnTestCaseResult> results = result.getTestCases();
    try (StringWriter sw = new StringWriter(); 
         CSVWriter writer = new CSVWriter(sw, CSVWriter.DEFAULT_SEPARATOR, 
                                          CSVWriter.NO_QUOTE_CHARACTER, 
                                          CSVWriter.NO_ESCAPE_CHARACTER, 
                                          CSVWriter.DEFAULT_LINE_END)) {

        String[] headers = {"Test Input", "Expected Output", "Test Output", "Error Message"};
        writer.writeNext(headers);

        for (DmnTestCaseResult testCase : results) {
            String testInput = testCase.getTestInput().toString();
            String expectedOutput = testCase.getExpectedOutput().toString();
            String errorMessage = testCase.getErrorMessage();

            if (testCase.getTestOutput().isEmpty()) {
                writer.writeNext(new String[]{testInput, expectedOutput, "", errorMessage});
            } else {
                for (Map<String, Object> output : testCase.getTestOutput()) {
                    writer.writeNext(new String[]{testInput, expectedOutput, output.toString(), errorMessage});
                }
            }
        }
        return sw.toString();
    } catch (Exception ex) {
        throw new CsvParseException(ex.getMessage());
    }
}
