["private int getNodeIndex(Map<String, Integer> nodeIndexMap, List<String> nodes, String node) {
    return nodeIndexMap.computeIfAbsent(node, k -> {
        nodes.add(k);
        return nodes.size() - 1;
    });
}

private void bfs(String source, Map<String, Integer> nodeIndexMap) {
    level = new int[nodes.size()];
    Arrays.fill(level, -1);
    level[getNodeIndex(nodeIndexMap, nodes, source)] = 0;

    Queue<String> queue = new LinkedList<>();
    queue.offer(source);

    while (!queue.isEmpty()) {
        String u = queue.poll();
        for (Map.Entry<String, Integer> entry : network.get(u).entrySet()) {
            String v = entry.getKey();
            int capacity = entry.getValue();
            int vIndex = getNodeIndex(nodeIndexMap, nodes, v);
            if (capacity > 0 && level[vIndex] == -1) {
                level[vIndex] = level[getNodeIndex(nodeIndexMap, nodes, u)] + 1;
                queue.offer(v);
            }
        }
    }
}

private int dfs(String u, int flow, String sink, Map<String, Integer> nodeIndexMap) {
    if (u.equals(sink)) {
        return flow;
    }

    for (Map.Entry<String, Integer> entry : network.get(u).entrySet()) {
        String v = entry.getKey();
        int capacity = entry.getValue();
        if (capacity > 0 && level[getNodeIndex(nodeIndexMap, nodes, u)] < level[getNodeIndex(nodeIndexMap, nodes, v)]) {
            int sent = dfs(v, Math.min(flow, capacity), sink, nodeIndexMap);
            if (sent > 0) {
                network.get(u).put(v, capacity - sent);
                network.get(v).put(u, network.get(v).getOrDefault(u, 0) + sent);
                return sent;
            }
        }
    }
    return 0;
}

public int calculator(Map<T, Set<T>> graph) {
    Map<String, Integer> nodeIndexMap = new HashMap<>();

    for (T t : graph.keySet()) {
        addEdge("src", "A" + t.toString(), 1);
        addEdge("B" + t, "sink", 1);
        Set<String> visitedSubset = new HashSet<>();
        for (String u : reach(graph, t, visitedSubset)) {
            addEdge("A" + t, u, 1);
        }
    }

    int maxFlow = 0;
    while (true) {
        bfs("src", nodeIndexMap);
        if (level[getNodeIndex(nodeIndexMap, nodes, "sink")] == -1) {
            break;
        }

        int flow;
        while ((flow = dfs("src", Integer.MAX_VALUE, "sink", nodeIndexMap)) > 0) {
            maxFlow += flow;
        }
    }

    return graph.size() - maxFlow;
}
"]

["public class AlarmReceiver extends BroadcastReceiver {
    private static Ringtone ringtone;

    @Override
    public void onReceive(Context context, Intent intent) {
        Vibrator vibrator = (Vibrator) context.getSystemService(Context.VIBRATOR_SERVICE);
        if (vibrator != null && vibrator.hasVibrator()) {
            vibrator.vibrate(VibrationEffect.createOneShot(500, VibrationEffect.DEFAULT_AMPLITUDE));
        }

        String event = intent.getStringExtra("title");
        String comment = intent.getStringExtra("comment");
        Intent activityIntent = new Intent(context, MainActivity.class);
        activityIntent.setFlags(Intent.FLAG_ACTIVITY_NEW_TASK | Intent.FLAG_ACTIVITY_CLEAR_TASK);
        PendingIntent pendingIntent = PendingIntent.getActivity(context, 0, activityIntent, PendingIntent.FLAG_UPDATE_CURRENT);

        Intent stopIntent = new Intent(context, NotificationDismissReceiver.class);
        PendingIntent stopPendingIntent = PendingIntent.getBroadcast(context, 0, stopIntent, PendingIntent.FLAG_UPDATE_CURRENT);

        NotificationCompat.Builder builder = new NotificationCompat.Builder(context, "myandroid")
                .setSmallIcon(R.drawable.alarm)
                .setContentTitle(event)
                .setContentText("Reminder for the Event:
" + event + "
Comments:
" + comment)
                .setAutoCancel(true)
                .setStyle(new NotificationCompat.BigTextStyle().bigText("Reminder for the Event:
" + event + "
Comments:
" + comment))
                .setContentIntent(pendingIntent)
                .setDeleteIntent(stopPendingIntent)
                .setDefaults(NotificationCompat.DEFAULT_ALL)
                .setPriority(NotificationCompat.PRIORITY_HIGH);

        NotificationManagerCompat notificationManager = NotificationManagerCompat.from(context);
        notificationManager.notify(123, builder.build());

        Uri notification = RingtoneManager.getDefaultUri(RingtoneManager.TYPE_ALARM);
        ringtone = RingtoneManager.getRingtone(context, notification);
        if (ringtone != null) ringtone.play();
    }

    public static void stopRingtone() {
        if (ringtone != null && ringtone.isPlaying()) {
            ringtone.stop();
        }
    }
}

public class NotificationDismissReceiver extends BroadcastReceiver {
    @Override
    public void onReceive(Context context, Intent intent) {
        AlarmReceiver.stopRingtone();
    }
}
