["def compute_hash(log_dict: dict):
    return hash(frozenset(log_dict.items()))

def deduplicate(logs):
    already_seen = set()
    for log in logs:
        log_hash = compute_hash(log)
        if log_hash in already_seen:
            continue
        already_seen.add(log_hash)
        yield log
"]

