["from datetime import date
from typing import Annotated
from pydantic import BaseModel, Field, field_validator, BeforeValidator

def to_date(field_name, value, formats, return_str=False):
    for fmt in formats:
        try:
            parsed_date = date.strptime(value, fmt)
            return parsed_date if not return_str else parsed_date.strftime(fmt)
        except ValueError:
            continue
    raise ValueError(f"Invalid date format for field {field_name}")

def custom_date(potential_formats):
    def validate_date(value, info):
        if isinstance(value, date):
            return value
        return to_date(info.alias, value, potential_formats, return_str=False)
    return Annotated[date, BeforeValidator(validate_date)]

class ExampleModel(BaseModel):
    dt: custom_date(['%Y-%m-%d', '%Y/%m/%d'])
"]

["from itertools import combinations

def generate_combinations(letters, k, n):
    def helper(remaining, groups):
        if not remaining:
            yield groups
            return
        first_group = combinations(remaining, n)
        for group in first_group:
            new_remaining = set(remaining) - set(group)
            yield from helper(new_remaining, groups + [tuple(sorted(group))])

    unique_combos = set()
    for combo in helper(set(letters), []):
        unique_combos.add(tuple(sorted(combo)))
    return [list(map(list, combo)) for combo in unique_combos]
"]

