["from typing import Callable, Dict
from functools import wraps

def remember(f: Callable[[int], int]) -> Callable[[int], int]:
    class Wrapper:
        memory: Dict[int, int]

        def __init__(self, f: Callable[[int], int]):
            self.f = f
            self.memory = {}

        def __call__(self, n: int) -> int:
            if n not in self.memory:
                self.memory[n] = self.f(n)
            return self.memory[n]

    @wraps(f)
    def wrapper(n: int) -> int:
        return wrapper._wrapper(n)

    wrapper._wrapper = Wrapper(f)
    return wrapper

@remember
def fib(n: int) -> int:
    if n < 2:
        return 1
    return fib(n - 2) + fib(n - 1)
"]

["import contextlib
from typing import List, Type

class Validator:
    def validate(self, something, *, suppress: List[Type[Exception]] = []) -> None:
        self._check_a(something, suppress)
        self._check_b(something, suppress)
        self._check_c(something, suppress)

    def _check_a(self, something, suppress: List[Type[Exception]]) -> None:
        if a:
            self._raise(ErrorA(), suppress)

    def _check_b(self, something, suppress: List[Type[Exception]]) -> None:
        if b:
            self._raise(ErrorB(), suppress)

    def _check_c(self, something, suppress: List[Type[Exception]]) -> None:
        if c:
            self._raise(ErrorC(), suppress)

    def _raise(self, e: Exception, suppress: List[Type[Exception]]) -> None:
        with contextlib.suppress(*suppress):
            raise e
"]

