["class FooMeta(type):
    def __len__(cls):
        return 9000

class GoodBar(metaclass=FooMeta):
    def __len__(self):
        return 9001

class BadBar(metaclass=FooMeta):
    @classmethod
    def __len__(cls):
        return 9002

def len_with_classmethod(cls):
    if isinstance(cls, type):
        return cls.__len__()
    return len(cls)

len_with_classmethod(BadBar)  # 9002
