["import pandas as pd

def get_closest_matches(df1, df2):
    result = []
    
    for sec in df1['seconds']:
        closest_idx = (df2['seconds'] - sec).abs().argmin()
        start_idx = max(closest_idx - 2, 0)
        end_idx = min(closest_idx + 2, len(df2) - 1)
        result.append(df2.iloc[start_idx:end_idx + 1])
    
    return pd.concat(result).drop_duplicates().reset_index(drop=True)

data1 = {
    'score': [1, 2],
    'seconds': [1140, 2100],
}

data2 = {
    'prize': [5.5, 14.5, 14.6, 21, 23, 24, 26, 38, 39, 40, 50],
    'seconds': [840, 1080, 1380, 1620, 1650, 1680, 1700, 1740, 2040, 2100, 2160],
}

df1 = pd.DataFrame.from_dict(data1)
df2 = pd.DataFrame.from_dict(data2)

result = get_closest_matches(df1, df2)
print(result)
"]

